import React, { Component } from 'react'
import styled from 'styled-components'
import Parallax from './Parallax.jsx'
import Un from '../images/tabe.jpg';


const Container = styled.div`
width:100%;
justify-content:center;
align-items:center;
margin:0 auto;
height:100%;
background:var(--secondary-color);
background-attachment:fixed;
background-image:url(${Un});
background-size:100% 100%;
z-index:1;
position:relative;

`
const Overlay = styled.div`
background-color:#1716168c;
position:relative;
margin-top:0%;
left:0%;
top:-0px;
width:100%;
height:100%;
padding: 0% 0% 3% 0%;
@media (max-width:425px){
  height:100%;
}
`

const Heading = styled.h2`
color: white;
margin: 0px;
text-align: center;
`
const Anchor=styled.a`
text-decoration:none;
color:white;
margin:15px 5px;
&:hover{
    color:var(--secondary-color);

  }
`
const Holder= styled.div`
margin:0 auto;
text-align:center;
display:flex;
justify-content:center;
color: var(--secondary-color);
`




class Gallery extends Component {

  render() {



    return (


        <Container id="Weddings">
          <Overlay>
          <Holder>
           <Anchor href="" class="icon"><i class="fa fa-envelope"></i></Anchor><Heading className="headings">{this.props.heading}</Heading>
           <Anchor href="" class="icon"><i class="fa fa-envelope"></i></Anchor>
           </Holder>



            <Parallax/>
                </Overlay>
        </Container>

    );
  }
}
export default Gallery;
